Hello, there are really nice projects,  thank you for talking **about me** and **my projects**, but **coogger's definition** is misspelled, coogger has been updated and hence its definition has changed. 

#### Definition of coogger;
A place where is information sharing network that works with communities, it provides them a steem interface and you can earn STEEM.

Example ;
[steemkitchen.com](http://www.steemkitchen.com) is another community that works with coogger ecosystem.

Thank you again.

@mmmmkkkk311 mogę tylko i wyłącznie podpisać się pod tym co @noisy napisał. Korzystam z Wise i wspieram jego głosem tagi #pl-psychologia, #pl-nauka i #pl-podroze oraz przez chwile wspierałem #pl-muzyka i działa to naprawdę rewelacyjnie i jest bardzo korzystne dla trzech stron (kuratora, delegatora głosu i autora postu).

Korzystałem z Twojej delegacji @mmmmkkkk311 przez te 2 (?) miesiące i bardzo się ciesze, że zawsze o te pare postów więcej mogłem wspierać polskich autorów. Mając tę delegację od Ciebie czułem też większą powinność by te tagi przeglądać i by dobrze spełniać swoją rolę nieoficjalnego kuratora. 

Pomimo całej tej dramy, w która nie do końca chcę się mieszać, jako osoba której wcześniej zaufałeś i przekazałeś delegację zachęcam do spróbowania Wise.

Im więcej o Wise czytam, im więcej pozytywnych komentarzy użytkowników już korzystających z niego przeglądam, tym bardziej upewniam się w przekonaniu, że ten projekt jest naprawdę świetny. I się póki co dobrze sprawdza. Mój post już został dzięki niemu doceniony głosem @noisy, chociaż wiem, że to nie on głosował. Eksperci dysponujący jego głosem mają co prawda troszkę więcej pracy, ale przynajmniej mają szansę nagrodzić tych, którzy na to zasługują. 

@mmmmkkkk311, pamiętam że kiedyś sam wspomniałeś, że rozważasz korzystanie z Wise jako alternatywna forma wsparcia polskiej społeczności zamiast delegacji SP do opiekunów tagów. Może ponownie to rozważysz? Zrobisz oczywiście jak uważasz. Jednak moim zdaniem to by była świetna sprawa :) I jeszcze raz wielkie dzięki za dotychczasowe wsparcie! 

Mam też cichą nadzieję, że gdy Wise stanie się bardziej powszechnych narzędziem, to nie będzie już takich sytuacji jak obecna **"wojna na/przez boty"** na tagu #polish. Niezbyt przyjemny jest taki konflikt, gdzie whitelist  jednego użytkownika staje się blacklist u drugiego. Nie daj Boże jakimś nieopatrznym upvotem się podpadnie którejś ze stron i już się zostanie zakwalifikowanym jako wróg... A ja bym po prostu chciał by zarówno moje posty, jak i posty innych użytkowników w tagu #polish były lepiej nagradzane.  Ale to koniec tej mojej dygresji. Po prostu naiwnie chciałbym, żeby było dobrze :)

